	srl	$s0, $s0, $s1			# top_row_bits >>= cell_bit_width

	sub	$s3, $s3, 1			# --col

	bgez	$s3, solve_apply_top_row_for

solve_apply_top_row_for_done:
	jal	chase_lights

solve_return:
	lw	$ra, 0($sp)
	lw	$s0, 4($sp) 
	lw	$s1, 8($sp)
	lw	$s2, 12($sp)
	lw	$s3, 16($sp)
	add	$sp, $sp, 20

	jr	$ra


.globl chase_lights
chase_lights:
	sub	$sp, $sp, 28
	sw	$ra, 0($sp)
	sw	$s0, 4($sp) 
	sw	$s1, 8($sp)
	sw	$s2, 12($sp)
	sw	$s3, 16($sp)
	sw	$s4, 20($sp)
	sw	$s5, 24($sp)

	lw	$s0, num_rows				# load num_rows
	lw	$s1, num_cols				# load num_cols
	lw	$s2, num_colors				# load num_colors

	li	$s5, 0					# puzzle_index = 0

	li	$s3, 1					# row = 1
chase_lights_row_for:
	# while (row < num_rows)

	li	$s4, 0					# col = 0
chase_lights_col_for:
	# while (col < num_cols)

	lbu	$t0, puzzle_board($s5)			# state = puzzle_board[puzzle_index]
	beq	$t0, $zero, chase_lights_col_for_nolight# if (state == 0) skip toggle light

	sub	$a2, $s2, $t0				# arg 2: actions = num_colors - state

	add	$t1, $s5, $s1				# next_row_index = puzzle_index + num_cols

	lbu	$t2, solution($t1)			# prev_soln = solution[next_row_index]
	add	$t2, $t2, $a2				# prev_soln += actions
	#rem	$t2, $t2, $s2				# prev_soln %= num_colors (not necessary b/c soln still valid)
	sb	$t2, solution($t1)			# solution[next_row_index] = prev_soln

#move	$a0, $s3				# arg 0: row
#move	$a1, $s4				# arg 1: col

### TOGGLE LIGHT
#jal	toggle_light				# toggle_light(row, col, actions)

    ## Variables corresponding to registers:

    ##
    ##	  $t6 = tmp_var
    ##	  $t5 = array_index
    ##	  $t4 = cond_var
    ##	  $a3 = board
    ##	  $s8 = num_colors
    ##	  $s7 = num_cols
    ##	  $s6 = num_rows
    ##	  $a2 = action_num
    ##	  $s4 = col
    ##	  $s3 = row
    ##
	## End aliases

	#lw	$t0, num_rows			# now $s6
	#lw	$t1, num_cols			# now $s7
	#lw	$t2, num_colors			# now $s8
	#la	$t3, puzzle_board		# now $a3

	# assign  $t5 = $a3&[$s3 * $s7 + $s4]
	mul	$t5, $s3, $s7
	add	$t5, $t5, $s4
	add	$t5, $t5, $a3
	# assign  $t6 = (*::($t5) + $a2) % $s8
	lbu	$t6, 0($t5)
	add	$t6, $t6, $a2
	div	$t6, $s8
	mfhi	$t6
	# assign  $t6 =>:: $t5
	sb	$t6, 0($t5)

chase_lights_toggle_light_row_greater_if:
	blez	$s3, chase_lights_toggle_light_col_greater_if

	# assign  $t5 = $a3&[($s3 - 1) * $s7 + $s4]
	addi	$t5, $s3, -1
	mul	$t5, $t5, $s7
	add	$t5, $t5, $s4
	add	$t5, $t5, $a3
	# assign  $t6 = (*::($t5) + $a2) % $s8
	#lbu	$t6, 0($t5)
	#add	$t6, $t6, $a2
	#div	$t6, $s8
	#mfhi	$t6
	# assign  $t6 =>:: $t5
	sb	$zero, 0($t5)

chase_lights_toggle_light_col_greater_if:
	blez	$s4, chase_lights_toggle_light_row_less_if

	# assign  $t5 = $a3&[($s3) * $s7 + $s4 - 1]
	mul	$t9, $s3, $s7
	add	$t9, $t9, $s4
	addi	$t5, $t9, -1
	add	$t5, $t5, $a3
	# assign  $t6 = (*::($t5) + $a2) % $s8
	lbu	$t6, 0($t5)
	add	$t6, $t6, $a2
	div	$t6, $s8
	mfhi	$t6
	# assign  $t6 =>:: $t5
	sb	$t6, 0($t5)

chase_lights_toggle_light_row_less_if:
	# assign  $t4 = $s6 - 1
	addi	$t4, $s6, -1
	bge	$s3, $t4, chase_lights_toggle_light_col_less_if

	# assign  $t5 = $a3&[($s3 + 1) * $s7 + $s4]
	addi	$t5, $s3, 1
	mul	$t5, $t5, $s7
	add	$t5, $t5, $s4
	add	$t5, $t5, $a3
	# assign  $t6 = (*::($t5) + $a2) % $s8
	lbu	$t6, 0($t5)
	add	$t6, $t6, $a2
	div	$t6, $s8
	mfhi	$t6
	# assign  $t6 =>:: $t5
	sb	$t6, 0($t5)

chase_lights_toggle_light_col_less_if:
	# assign  $t4 = $s7 - 1
	addi	$t4, $s7, -1
	bge	$s4, $t4, chase_lights_toggle_light_end

	# assign  $t5 = $a3&[($s3) * $s7 + $s4 + 1]
	mul	$t5, $s3, $s7
	add	$t5, $t5, $s4
	addi	$t5, $t5, 1
	add	$t5, $t5, $a3
	# assign  $t6 = (*::($t5) + $a2) % $s8
	lbu	$t6, 0($t5)
	add	$t6, $t6, $a2
	div	$t6, $s8
	mfhi	$t6
	# assign  $t6 =>:: $t5
	sb	$t6, 0($t5)

chase_lights_toggle_light_end:

### END TOGGLE LIGHT

chase_lights_col_for_nolight:
	add	$s5, $s5, 1				# puzzle_index += 1
	add	$s4, $s4, 1				# col += 1

	bne	$s4, $s1, chase_lights_col_for

chase_lights_col_for_done:
	add	$s3, $s3, 1				# row += 1

	bne	$s3, $s0, chase_lights_row_for

chase_lights_row_for_done:
	lw	$ra, 0($sp)
	lw	$s0, 4($sp)
	lw	$s1, 8($sp)
	lw	$s2, 12($sp)
	lw	$s3, 16($sp)
	lw	$s4, 20($sp)
	lw	$s5, 24($sp)
	add	$sp, $sp, 28

	jr	$ra


